import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Portfolio = () => {
    const [prices,setPrices] = useState([]);
    // const alpha = require('alphavantage')({ key : process.env.REACT_APP_ALPHA_VANTAGE_API_KEY });
    useEffect(() => {
        let url = 'https://www.alphavantage.co/query?';
        let func = 'TIME_SERIES_INTRADAY';
        let symbol = 'MSFT';
        let apiKey = process.env.REACT_APP_ALPHA_VANTAGE_API_KEY;
        let interval = '5min';
        // console.log(`${url}function=${func}&symbol=${symbol}&interval=${interval}&apikey=${apiKey}`)
        // console.log('https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=MSFT&interval=5min&apikey=demo')        
        // fetch(`${url}function=${func}&symbol=${symbol}&interval=${interval}&apikey=${apiKey}`)
        axios.get(`${url}function=${func}&symbol=${symbol}&interval=${interval}&apikey=${apiKey}`)
        .then(json => {
            console.log(json)
            // console.log(Object.entries(json))
            return Object.entries(json);
        })
        .then(data => {
            setPrices(data)
            console.log('hi');
        });
    },[])

    // const getValues = () => {
    //     let microsoft
    //         microsoft = data['Time Series (1min)'];
    //         // console.log(Object.keys(data))
    //     });
    //     return microsoft;
    // }

    return (
        <div>
            {prices}
        </div>
    );
}
 
export default Portfolio;
